import React, { useEffect, useState } from 'react';
import './CartItems.css';
import remove_icon from '../Assets/cart_cross_icon.png';

const CartItems = ({ userId }) => {
  const [cart, setCart] = useState([]);
  const [total, setTotal] = useState(0);

  const fetchCart = async () => {
    try {
      const response = await fetch(`http://localhost:5000/cart/get-cart/${userId}`);
      const data = await response.json();
      if (data.success) {
        setCart(data.cart.productsInCart);
        calculateTotal(data.cart.productsInCart);
      }
    } catch (error) {
      console.error('Error fetching cart:', error);
    }
  };

  const calculateTotal = (items) => {
    const totalAmount = items.reduce((sum, item) => sum + item.productId.new_price * item.quantity, 0);
    setTotal(totalAmount);
  };

  const handleRemove = async (productId) => {
    try {
      await fetch('http://localhost:5000/cart/delete-item', {
        method: 'DELETE',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ userId, productId }),
      });
      fetchCart();
    } catch (error) {
      console.error('Error removing item:', error);
    }
  };

  useEffect(() => {
    fetchCart();
  }, []);

  return (
    <div className='cartitems'>
      <div className="cartitems-format-main">
        <p>Products</p>
        <p>Title</p>
        <p>Price</p>
        <p>Quantity</p>
        <p>Total</p>
        <p>Remove</p>
      </div>
      <hr />
      {cart.map((item) => (
        <div key={item.productId._id}>
          <div className="cartitems-format cartitems-format-main">
            <img className='carticon-product-icon' src={item.productId.image} alt="" />
            <p>{item.productId.name}</p>
            <p>${item.productId.new_price}</p>
            <p>{item.quantity}</p>
            <p>${item.productId.new_price * item.quantity}</p>
            <img
              className='cartitems-remove-icon'
              src={remove_icon}
              onClick={() => handleRemove(item.productId._id)}
              alt=""
            />
          </div>
          <hr />
        </div>
      ))}
      <div className="cartitems-down">
        <div className="cartitems-total">
          <h1>Cart Total</h1>
          <div>
            <div className="cartitems-total-item">
              <p>Subtotal</p>
              <p>${total}</p>
            </div>
            <hr />
            <div className="cartitems-total-item">
              <p>Shipping Fee</p>
              <p>Free</p>
            </div>
            <hr />
            <div className="cartitems-total-item">
              <h3>Total</h3>
              <h3>${total}</h3>
            </div>
          </div>
          <button>PROCEED TO CHECKOUT</button>
        </div>
        <div className="cartitems-promocode">
          <p>If you have a promo code, Enter it here</p>
          <div className="cartitems-promobox">
            <input type="text" placeholder='promo code' />
            <button>Submit</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CartItems;
